import React, {useState, useEffect }from "react";
import { Helmet } from 'react-helmet';
import CocktailsDataService from "../../services/cocktails.js"

import { Title, Wrapper } from './home.style'

const Home = () => {
    const [cocktails, setCocktails] = useState([]);

    useEffect(() => {
        retrieveCocktails();
    }, []);

    const retrieveCocktails = () => {
        CocktailsDataService.getAll()
        .then(response => {
            console.log(response.json().cocktails);
            const [item] = response.json().cocktails;
            setCocktails(item);
        })
        .catch(e => {
            console.log(e);
        })
    }

    return (
        <div className="App">
            <Helmet>
                <style>{'body {background-color: orange; }'}</style>
            </Helmet>
            <Wrapper>
                <Title>
                    Cocktail of the Day                
                </Title>
            </Wrapper>
                {cocktails.map((cocktail) => {
                    return (
                        <div>{cocktail.Cocktail}</div>
                    );
                })}
        </div>

    )

}

export default Home;
